import React, { useState, useEffect } from "react";
import api from "../../api";
import QualitiesList from "../qualitiesList";

const UserPage = ({ match }) => {
  const [users, setUsers] = useState();
  useEffect(async () => {
    Promise.all(api.users.getById(`${match.params.userId}`)).then((data) => setUsers(data));
  }, []);

  let a = {};
  a = { ...a, ...(a.name = users.name) };
  const profession = a.profession;

  console.log("wwww", users, "aaa", profession);
  return (
    <div>
      <h1>{a.name}</h1>
      <h2>Профессия: </h2>
      <h2>{/* <QualitiesList qualities={a} /> */}</h2>
    </div>
  );
};

export default UserPage;
